isher.com/institutional-members.php&amp;lt;/strong&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;If you choose to also publish your article as Open Access, then please mention the Discount Code:&amp;amp;nbsp;&amp;lt;strong&amp;gt;2020-BENTHMFUB-11-16&amp;lt;/strong&amp;gt;, when you submit your manuscript.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;View a list of Bentham Science journals here:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;https://www.eurekaselect.net/bypublication&amp;quot; target=&amp;quot;_blank&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;https://www.eurekaselect.net/bypublication&amp;lt;/strong&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Also, you can access relevant, full-text articles published in Bentham Science journals, through the Bentham Science website link given above.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;If you wish to join the Editorial Board of any Bentham Science journal, please send the title of your preferred journal, your latest CV and list of publications, in reply to this email.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;We will look forward to receiving your manuscripts. Thank you.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Best regards,&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Noman Akbar&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Marketing Manager&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Bentham Science&amp;lt;/p&amp;gt;','&',0,NULL,'Verified','15',NULL,'2022-01-12 02:39:54'),(26,33,'&amp;lt;p&amp;gt;here is the subject for draft.{journal_title},{article_title}&amp;lt;/p&amp;gt;','&',1,'dsgree','Rejected','15',NULL,'2022-01-12 04:59:11'),(27,39,'&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Bentham Science Publishers&amp;lt;/strong&amp;gt;&amp;amp;nbsp;has a&amp;amp;nbsp;&amp;lt;strong&amp;gt;&amp;amp;lsquo;Read and Publish&amp;amp;rsquo;&amp;lt;/strong&amp;gt;&amp;amp;nbsp;partnership with the German consortium&amp;amp;nbsp;&amp;lt;strong&amp;gt;&amp;amp;lsquo;Specialized Information Services for Science&amp;amp;rsquo; Pharmacy (Fachinformationsdienst Pharmazie FID PubPharm)&amp;lt;/strong&amp;gt;. This consortium covers important German universities, including your institution,&amp;amp;nbsp;&amp;lt;strong&amp;gt;Heidelberg University&amp;lt;/strong&amp;gt;. This partnership provides authors and researchers from your university, an opportunity to publish their research as&amp;amp;nbsp;&amp;lt;strong&amp;gt;Gold Open Access&amp;lt;/strong&amp;gt;, at a&amp;amp;nbsp;&amp;lt;strong&amp;gt;50% discount&amp;lt;/strong&amp;gt;&amp;amp;nbsp;on our listed Gold Open Access Charges, which range from &amp;amp;euro;1,000 to &amp;amp;euro;4,000 per article, depending on the journal selected.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;We welcome you to submit your manuscripts, for publishing in your preferred Bentham journals. Please fill the following form to submit your article for initial approval:&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;a href=&amp;quot;https://benthamsciencepublisher.com/institutional-members.php&amp;quot; target=&amp;quot;_blank&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;https://benthamsciencepublisher.com/institutional-members.php&amp;lt;/strong&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;If you choose to also publish your article as Open Access, then please mention the Discount Code:&amp;amp;nbsp;&amp;lt;strong&amp;gt;2020-BENTHMFUB-11-16&amp;lt;/strong&amp;gt;, when you submit your manuscript.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;View a list of Bentham Science journals here:&amp;amp;nbsp;&amp;lt;a href=&amp;quot;https://www.eurekaselect.net/bypublication&amp;quot; target=&amp;quot;_blank&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;https://www.eurekaselect.net/bypublication&amp;lt;/strong&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Also, you can access relevant, full-text articles published in Bentham Science journals, thr