_title} , {article_title}&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;','here is the subject line',32,'2021-12-08',NULL),(29,'&lt;p&gt;here is the subject for draft.{journal_title},{article_title}&lt;/p&gt;','draft for Camp 23 subject',33,'2021-11-17',NULL),(30,'&lt;p&gt;here is the draft for you to test&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;','draft for Camp 23 subject test',34,'2021-11-18',NULL),(31,'&lt;p&gt;here is the test for you&lt;/p&gt;','draft for Camp 2 subject. testing rejected',31,'2021-11-18',NULL),(33,'&lt;p&gt;here id the draft&amp;nbsp; for test .&lt;/p&gt;','automatic Campaign',35,'2021-11-19',NULL),(35,'&lt;p&gt;test trail to check import.php&lt;/p&gt;','draft for Camp 2',37,'2021-11-22',NULL),(37,'&lt;p&gt;&lt;strong&gt;Bentham Science Publishers&lt;/strong&gt;&amp;nbsp;has a&amp;nbsp;&lt;strong&gt;&amp;lsquo;Read and Publish&amp;rsquo;&lt;/strong&gt;&amp;nbsp;partnership with the German consortium&amp;nbsp;&lt;strong&gt;&amp;lsquo;Specialized Information Services for Science&amp;rsquo; Pharmacy (Fachinformationsdienst Pharmazie FID PubPharm)&lt;/strong&gt;. This consortium covers important German universities, including your institution,&amp;nbsp;&lt;strong&gt;Heidelberg University&lt;/strong&gt;. This partnership provides authors and researchers from your university, an opportunity to publish their research as&amp;nbsp;&lt;strong&gt;Gold Open Access&lt;/strong&gt;, at a&amp;nbsp;&lt;strong&gt;50% discount&lt;/strong&gt;&amp;nbsp;on our listed Gold Open Access Charges, which range from &amp;euro;1,000 to &amp;euro;4,000 per article, depending on the journal selected.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;We welcome you to submit your manuscripts, for publishing in your preferred Bentham journals. Please fill the following form to submit your article for initial approval:&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;https://benthamsciencepublisher.com/institutional-members.php&quot; target=&quot;_blank&quot;&gt;&lt;strong&gt;https://benthamsciencepublisher.com/institutional-members.php&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;If you choose to also publish your article as Open Access, then please mention the Discount Code:&amp;nbsp;&lt;strong&gt;2020-BENTHMFUB-11-16&lt;/strong&gt;, when you submit your manuscript.&lt;/p&gt;\r\n\r\n&lt;p&gt;View a list of Bentham Science journals here:&amp;nbsp;&lt;a href=&quot;https://www.eurekaselect.net/bypublication&quot; target=&quot;_blank&quot;&gt;&lt;strong&gt;https://www.eurekaselect.net/bypublication&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Also, you can access relevant, full-text articles published in Bentham Science journals, through the Bentham Science website link given above.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you wish to join the Editorial Board of any Bentham Science journal, please send the title of your preferred journal, your latest CV and list of publications, in reply to this email.&lt;/p&gt;\r\n\r\n&lt;p&gt;We will look forward to receiving your manuscripts. Thank you.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Best regards,&lt;/p&gt;\r\n\r\n&lt;p&gt;Noman Akbar&lt;/p&gt;\r\n\r\n&lt;p&gt;Marketing Manager&lt;/p&gt;\r\n\r\n&lt;p&gt;Bentham Science&lt;/p&gt;','test draft',39,'2022-01-20',NULL),(49,'&lt;p&gt;here is the &lt;strong&gt;test draft&lt;/strong&gt; for campaign created on 20 dec 2021.&lt;/p&gt;\r\n\r\n&lt;p&gt;Regards,&lt;/p&gt;\r\n\r\n&lt;p&gt;Admin&lt;/p&gt;','draft for Camp 2o dec',55,'2021-12-20',NULL),(50,'&lt;p&gt;new campaign jan62022&lt;/p&gt;','draft subjectJan62022',56,'2022-01-06',NULL),(51,'&lt;p&gt;my draft has message&lt;/p&gt;','AlenCampJan7',57,'2022-01-07',NULL),(52,'&lt;p&gt;&lt;strong&gt;Bentham Science Publishers&lt;/strong&gt;&amp;nbsp;has a&amp;nbsp;&lt;strong&gt;&amp;lsquo;Read and Publish&amp;rsquo;&lt;/strong&gt;&amp;nbsp;partnership with the German consortium&amp;nbsp;&lt;strong&gt;&amp;lsquo;Specialized Information Services for Science&amp;rsquo; Pharmacy (Fachinformationsdienst Pharmazie FID PubPharm)&lt;/strong&gt;. This consortium covers important German universities, including your institution,&amp;nbsp;&lt;strong&gt;Heidelberg University&lt;/strong&gt;. This partnership provides authors and researchers from your university, an opportunity to publish their research as&amp;nbsp;&lt;strong&gt;Gold Open Access&lt;/strong&gt;, at a&amp;nbsp;&lt;strong&gt;50% discount&lt;/strong&gt;&amp;nbsp;on our listed Gold Open Access Charges, which range from &amp;euro;1,000 to &amp;euro;4,000 per article, depending on the journal selected.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;We welcome you to submit your manuscripts, for publishing in your preferred Bentham journals. Please fill the following form to submit your article for initial approval:&amp;nbsp;&lt;/strong&gt;&lt;a href=&quot;https://benthamsciencepublisher.com/institutional-members.php&quot; target=&quot;_blank&quot;&gt;&lt;strong&gt;https://benthamsciencepublisher.com/institutional-members.php&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;If you choose to also publish your article as Open Access, then please mention the Discount Code:&amp;nbsp;&lt;strong&gt;2020-BENTHMFUB-11-16&lt;/strong&gt;, when you submit your manuscript.&lt;/p&gt;\r\n\r\n&lt;p&gt;View a list of Bentham Science journals here:&amp;nbsp;&lt;a href=&quot;https://www.eurekaselect.net/bypublication&quot; target=&quot;_blank&quot;&gt;&lt;strong&gt;https://www.eurekaselect.net/bypublication&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Also, you can access relevant, full-text articles published in Bentham Science journals, through the Bentham Science website link given above.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you wish to join the Editorial Board of any Bentham Science journal, please send the title of your preferred journal, your latest CV and list of publications, in reply to this email.&lt;/p&gt;\r\n\r\n&lt;p&gt;We will look forward to receiving your manuscripts. Thank you.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Best regards,&lt;/p&gt;\r\n\r\n&lt;p&gt;Noman Akbar&lt;/p&gt;\r\n\r\n&lt;p&gt;Marketing Manager&lt;/p&gt;\r\n\r\n&lt;p&gt;Bentham Science&lt;/p&gt;','Specialized Information Services for Science',30,'2022-01-11',NULL),(54,'&lt;p&gt;Please prepare the new page for Graphical Abstracts. Dr. Sb and Jalil Sb have approved&amp;nbsp;the following&amp;nbsp;text.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Graphical Abstracts&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The use of a visually appealing graphical abstract boosts the article&amp;#39;s readership by grabbing the reader&amp;#39;s attention. It also provides a concise overview of the work presented in the paper.&lt;/p&gt;\r\n\r\n&lt;p&gt;It has been generally observed that an article&amp;#39;s viewership and citations improve when it has a graphical abstract.&lt;/p&gt;\r\n\r\n&lt;p&gt;Authors must submit a unique image that accurately depicts the work reported in the paper. Each manuscript must contain a graphical abstract in the Table of Contents (TOC).&lt;/p&gt;\r\n\r\n&lt;p&gt;Graphical abstracts should be uploaded as a separate file in&amp;nbsp;our&amp;nbsp;Online Manuscript Processing System (MPS), using the &amp;quot;Graphical Abstract&amp;quot; drop-down list when uploading files. It must not be embedded in the main manuscript file.&lt;/p&gt;\r\n\r\n&lt;p&gt;Please keep in mind that, just like each paper, each graphical abstract should be original.&lt;/p&gt;\r\n\r\n&lt;p&gt;The illustration of the&amp;nbsp;graphical abstract should have a clear beginning and conclusion for ease of browsing, preferably &amp;quot;reading&amp;quot; from top to bottom or left to right. As much as possible, try to eliminate distracting and cluttered aspects.&lt;/p&gt;','graphs',40,'2022-01-20',NULL),(55,'&lt;h1&gt;Please do the&lt;strong&gt; correction marked&lt;/strong&gt; in below attached PDF&lt;/h1&gt;\r\n\r\n&lt;h1&gt;and return corrected PDF at your earliest.&lt;/h1&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Regards,&lt;/p&gt;\r\n\r\n&lt;p&gt;Shumaim Mazhar (IBG)&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;Asst. Manager&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;Current Pharmaceutical Design&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;Bentham Science Publishers&lt;/em&gt;&lt;/p&gt;','draft for Camp 2ojan',58,'2022-01-20',NULL);
/*!40000 ALTER TABLE `draft` ENABLE KEYS */;
UNLOCK TABLES;

